class DeckContainer extends Component {

  constructor() {
    super();

    this.state = {
      pack: []
    }
  }

  componentWillUnmount() {
    this.props.setHintNum(5);
  }

  componentWillMount() {
    let store = [];
      DB.transaction(tx => {
        tx.executeSql('select * from Q where category = ?;', [this.props.deck.toLowerCase()], (_, { rows: { _array } }) => {

              for (var i = 0; i < _array.length; i++) {
                let source = [];
                let music = this.props.deck === 'Music' ? MUSIC[parseInt(_array[i].music)-1] : null;

                for (var j = 0; j < _array[i].source.split(',').length; j++) {
                  if (_array[i].source.split(',')[j] !== 'null') {
                    source.push({uri:'data:image/jpeg;base64,'+_array[i].source.split(',')[j]});
                  }
                }

                if (!source.length) {
                  source.push({uri:'data:image/jpeg;base64,'});
                  //music default image
                }

                store.push( { ..._array[i], id:(i+1), title:('Question '+(i+1)), options:_array[i].options.split(','), answers:_array[i].answers.split(','), source, music } );
                this.setState({pack:store});
              }
            }
          );
      });
  }

  render() {
    let chain = this.props.mode === 'Challenge' ? this.props.correct : -1;
    let time = this.props.mode === 'Time' ? true : false;
    let loaded = this.state.pack.length !== 0 ? true : false;

    if (loaded) {
      return (
          <View 
            style={{
              width:Dimensions.get('window').width-10,
              height:Dimensions.get('window').height,
              marginTop: 25
            }}
          >
            <Swiper
              pack={this.state.pack}
              renderQuiz={item=>{
                return(
                  <Animated.View>
                    <Quiz 
                      key={item.id}
                      id={item.id}
                      title={item.title}
                      question={item.question}
                      options={item.options}
                      answers={item.answers}
                      source={item.source}
                      music={item.music}
                    />
                  </Animated.View>
                  );
                }
              }
            />
            <View style={{marginTop:Dimensions.get('window').height-86}}>
              <Scores correct={this.props.correct} wrong={this.props.wrong} chain={chain} time={time}/>
            </View>
          </View>
      );
    } else {
      return null;
    }
  }
}

const mapStateToProps = (state) => {
  const { correct, wrong, mode, deck } = state.quiz;

  return { correct, wrong, mode, deck };
}

export default connect(mapStateToProps,{setHintNum})(DeckContainer);